import React from 'react'
import axios from "axios";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
const Logout = () => {
    function submitLogout(e) {
        e.preventDefault();
        axios
          .post("http://127.0.0.1:8000/auth/logout/", {
            Headers: {
              Authorization: `Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ0b2tlbl90eXBlIjoiYWNjZXNzIiwiZXhwIjoxNjg4Nzc4MDcwLCJpYXQiOjE2ODg3NzA4NzAsImp0aSI6ImNjMjBmZDYzNjE5YjQ4YTZhNGViOTg5OTM1YWRhZWE2IiwidXNlcl9pZCI6Nn0.6pbFAkRz3oZQrdiIfZNee1j8nWgp4te891hVQfKEWSM`,
            },
          })
          .then(function (res) {
          });
      }
  return (
    <div>   <Navbar bg="dark" variant="dark">
    <Container>
      <Navbar.Brand>HR System</Navbar.Brand>
      <Navbar.Toggle />
      <Navbar.Collapse className="justify-content-end">
        <Navbar.Text>
          <form onSubmit={(e) => submitLogout(e)}>
            <Button type="submit" variant="light">
              Log out
            </Button>
          </form>
        </Navbar.Text>
      </Navbar.Collapse>
    </Container>
  </Navbar></div>
  )
}

export default Logout
